import React,{useEffect,useCallback,useState} from 'react'
import { connect } from 'react-redux';
import axios from 'axios'
import store from '../../Controllers/Store/store'
import * as actions from '../../Controllers/Actions/Actions'
import TopNav from './TopNav'

function Home(){
    const [name,setName] = useState("loading..");
    useEffect(() => {
        document.title = "Home | Friend Finder";
        axios.post('http://localhost:4000/check-login',[localStorage.getItem('key')])
        .then(res=>{
            store.dispatch(actions.addUserName(res.data))
            try{
                setName(store.getState().setName[0].name)
                console.log(name)
            }
            catch(err){
                console.log(err.message);
            }
        })
        .catch(err=>{
            alert(err)
        })
    }, [])

    const names = useCallback(
        () => {
            return(
                <p className="user-name">{name}</p> 
            )
        },
    [name],)
    return(
        <div className="home">
            {/* <TopNav name={store.getState().setName[0].name} /> */}
            <div className="home-top-nav">
                <div className="top-nav-margin"> 
                    <h1>f</h1>
                    <div className="top-nav-right">
                        {names()}
                        <ul className="home-top-nav-list">
                            <li><i className="fa fa-bell"></i></li>
                            <li><i className="fa fa-users"></i></li>
                            <li><i className="fa fa-envelope"></i></li>
                            <li><i className="fa fa-caret-down"></i></li>
                        </ul>
                    </div>
                </div>
            </div>
            <div className="main-content">
                <div className="home-people-you-may-know">
                    <p>People you may know</p>
                </div>
            </div>
        </div>
    )
}

export default connect(
    null,
    { actions }
)(Home);
